import React from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { selectCount } from './gridSlice'


export default function Counter() {
    const count = Number(useSelector(selectCount))
    console.log(count)
    let word = ""
    if (count === 0) {
        word = "no living cell"
    } else if (count === 1) {
        word = "1 living cell"
    } else {
        word = {count} + " living cells"
    }

    return (
        <h2>{word}</h2>
    )
}
